Here's the code to accomplish this:

```json
{
  "http": {
    "uri": "plugin/http@1.1.0"
  },
  "filesystem": {
    "uri": "plugin/file-system@1.0.0"
  }
}
```

```json
{
  "http": {
    "method": "get",
    "url": "https://silennaihin.com/random/plain.html"
  }
}
```

```json
