  "filesystem": {
    "method": "writeFile",
    "path": "output.txt",
    "data": "<content>"
  }
}
```

Please note that you need to replace `<content>` with the actual content fetched from the webpage.

Once you have completed the goal, you can call the `onGoalAchieved` function on the `user` wrap.

Let me know if you need any further assistance!

