```python
import os
import shutil
import argparse

def organize_files(directory_path):
    # Define the file types and corresponding directories
    file_types = {
        'images': ['.jpg', '.png', '.gif', '.jpeg', '.tiff', '.bmp', '.ico'],
        'documents': ['.doc', '.docx', '.pdf', '.txt', '.xls', '.xlsx', '.ppt', '.pptx'],
        'audio': ['.mp3', '.wav', '.flac', '.m4a', '.aac']
    }

    # Create the directories if they don't exist
    for directory in file_types.keys():
        if not os.path.exists(os.path.join(directory_path, directory)):
            os.makedirs(os.path.join(directory_path, directory))

    # Iterate over the files in the directory and move them to the corresponding directories
    for filename in os.listdir(directory_path):
        for directory, extensions in file_types.items():
            if any(filename.endswith(extension) for extension in extensions):
                shutil.move(os.path.join(directory_path, filename), os.path.join(directory_path, directory))

if __name__ == "__main__":
    parser = argparse.ArgumentParser(description='Organize files in a directory based on their types.')
    parser.add_argument('--directory_path', required=True, help='The path of the directory to organize.')
    args = parser.parse_args()

    organize_files(args.directory_path)
```

